import React from 'react';
import logo from './logo.svg';
import './App.css';

function getRandom(min, max) {
    min = Math.ceil(min);
    max = Math.floor(max);
    return Math.floor(Math.random() * (max - min + 1)) + min;
}


function Input(){
  return (
     <input maxlength="2" size="3"/>
  )
}

function App() {
  const value1 = getRandom(1,9)
  const value2 = getRandom(1,9)
  return (
  <div className="App">
    <header className="App-header">
    <p>
     Vardhan G, lets do Maths...
     </p>
<form>
    <div class="box">
       {value1}  +  {value2} = <Input />
    </div>
</form>
     </header>
  </div>
   )
}

export default App;

